function BackgroundImage() {
    const backgroundImageStyle = {
      backgroundImage: `url(${backgroundImage})`,
      backgroundPosition: 'center',
      backgroundSize: 'cover',
      backgroundRepeat: 'no-repeat',
      width: '200px',   // eller en annan värde beroende på hur stor du vill ha bilden
      height: '200px',  // eller en annan värde beroende på hur stor du vill ha bilden
      position: 'fixed',
      bottom: '20px',   // justera värdena för att placera bilden exakt där du vill
      right: '20px',
    };
  
    return <div style={backgroundImageStyle}></div>;
  }
